    const double clhs67 =             X1(1,2)*clhs64;
    const double clhs68 =             2*u1(0,2);
    const double clhs69 =             X1(2,1)*clhs64;
    const double clhs70 =             2*clhs69;
    const double clhs71 =             4*u1(2,1);
    const double clhs72 =             X1(2,2)*clhs64;
    const double clhs73 =             2*clhs72;
    const double clhs74 =             4*u1(2,2);
    const double clhs75 =             clhs64*u1(0,1);
    const double clhs76 =             clhs64*u1(0,2);
    const double clhs77 =             clhs64*u1(1,1);
    const double clhs78 =             clhs64*u1(1,2);
    const double clhs79 =             X1(0,0)*X1(1,1);
    const double clhs80 =             X1(2,0)*clhs79;
    const double clhs81 =             2*clhs80;
    const double clhs82 =             4*u1(1,1);
