    const double clhs84 =             X1(2,1)*clhs79;
    const double clhs85 =             2*clhs84;
    const double clhs86 =             clhs79*u1(2,1);
    const double clhs87 =             clhs79*u1(0,1);
    const double clhs88 =             clhs79*u1(1,0);
    const double clhs89 =             clhs79*u1(2,0);
    const double clhs90 =             2*clhs89;
    const double clhs91 =             X1(0,0)*X1(1,2);
    const double clhs92 =             X1(2,0)*clhs91;
    const double clhs93 =             2*clhs92;
    const double clhs94 =             4*u1(1,2);
    const double clhs95 =             X1(2,2)*clhs91;
    const double clhs96 =             2*clhs95;
    const double clhs97 =             clhs91*u1(2,2);
    const double clhs98 =             clhs91*u1(0,2);
    const double clhs99 =             clhs91*u1(1,0);
