    const double clhs107 =             clhs102*u1(1,1);
    const double clhs108 =             2*clhs107;
    const double clhs109 =             clhs102*u1(1,2);
    const double clhs110 =             2*clhs109;
    const double clhs111 =             X1(0,0)*X1(2,1);
    const double clhs112 =             clhs111*u1(1,1);
