    const double clhs114 =             clhs111*u1(1,0);
    const double clhs115 =             2*clhs114;
    const double clhs116 =             2*clhs112;
    const double clhs117 =             X1(0,0)*X1(2,2);
    const double clhs118 =             clhs117*u1(1,2);
    const double clhs119 =             clhs117*u1(0,2);
    const double clhs120 =             clhs117*u1(1,0);
    const double clhs121 =             2*clhs120;
